import React from 'react';
import {Link} from 'react-router-dom';

function Navigation() {
  return (
    <ul>
    <li><Link to="/">Главная</Link></li>
    <li><a href="#">О нас</a></li>
    <li><Link to="/books">Доступные книги</Link></li>
    <li><a href="#">Вход</a></li>
    </ul>
    );
}
export default Navigation;
